;; Calculates c(w, x) where m is encoded in the length of w
(defn curve [w x]
  (let [m (first (shape w))
        phi (map #(pow %1 %2)
                  (into [] (repeat m x))
                  (range 0 m 1))]
    (dot w phi)))

;; with-primitive-procedures is an Anglican macros allowing you
;; to use non-Anglican functions withing Anglican queries.
(with-primitive-procedures [zero-vector diagonal-matrix dot shape curve]
  (defquery fit-curve [xs ys]
    (let [m (sample (poisson 5))
          w (sample (mvn (zero-vector (+ m 1)) 
                         (diagonal-matrix (repeat (+ m 1) 1.0))))]
      (map (fn [x y] 
             (observe (normal (curve w x) 1.0) y))
           xs
           ys)
      {:m m :w w})))
